import { Link } from 'react-router-dom'
import styled from 'styled-components'
import color from '../../utils/Styles/colors'

function Header() {
    const StyledLink = styled(Link)`
    padding: 15px;
    color: ${color.primary};
    text-decoration: none;
    font-size: 18px
    ${(props) =>
        props.$isFullLink &&
        `font-color: white; color: white; border-radius: 30px; background-color: ${color.primary};`}
`

    const StyledHeader = styled.div`
    text-align: right;
    padding: 32;
    border-bottom: solid 2px rgb(6, 164, 64);
    display: flex;
    flex-direction: row;
    justify-content: right;
    align-items: right;
`

    return (
        <StyledHeader>
            <img src='../../Assets/dark-logo.png' pro></img>
            <StyledLink to= "/" $isFullLink> Accueil</StyledLink>
            <StyledLink to="/survey/42" >Questionnaire</StyledLink>
            <StyledLink to="/freelance">freelances</StyledLink>
        </StyledHeader>
    )
}

export default Header
